import React from 'react'
import { Link } from 'react-router-dom'

const items = [{
  title: 'pageone',
  link: '/pageone'
}, 
{
  title: 'pagetwo',
  link: '/pagetwo'
}]

const Header = (props) => {
  return (
    <div className="header-container">
      { items.map((elem, index) => 
        <li> 
          <Link 
            to={ elem.link }
            key={elem.link + index}> 
            { elem.title }
          </Link>
        </li>  
      )}
    </div>
  )
}

export default Header
